option::Option::<T>::take.doc:
Takes the value out of the option, leaving a [`None`] in its place.

# Examples

```
let mut x = Some(2);
let y = x.take();
assert_eq!(x, None);
assert_eq!(y, Some(2));

let mut x: Option<u32> = None;
let y = x.take();
assert_eq!(x, None);
assert_eq!(y, None);
```

